import React, {useState} from 'react';

function Album({album}) {
    return (
        <div className='Album-card'>
            <img className='Album-image' src={album.image} alt={album.title}/>
            <p><span className='column1'>Title:</span> <span className='column2'>{album.title}</span></p>
            <p><span className='column1'>Artist:</span> <span>{album.artist}</span></p>
            <p><span className='column1'>Length:</span> <span>{album.length}</span></p>
            <ol>
                <h4>Tracklist:</h4>
                {album.tracks.map(track => (
                    <li key={track}>{track}</li>
                ))}
            </ol>
        </div>
    )
}

export default Album;
